const Home = () => {
    return ( 
        <div className="home-content">
            <div className="name-box">
                <div className="name">I'm <span>Anqi</span> Chen.</div>
            </div>

            <div className="intro">
                <div className="intro-text">I study Architecture and Human-Computer Interaction <br></br>@ Carnegie Mellon University.<br></br>
                Actively seeking opportunity to explore <span className="">Development & Design </span>for <span>Inclusion & Improvement</span>. </div>
            </div>

        </div>
    );
}
 
export default Home;
